So far we've seen how to create a handler, but we also must let the Server struct know of them. Before checking how this is done, let's check at the different types of request handlers, as defined in lib.rs: Any: This handler will be executed on any requested at the specified target Specific: This handler will be executed only on requests made using a specific HTTP method (GET, POST, etc) at the specified target Directory: This handler type requires a seperate chapter on its own and won't be covered here. All you need to know is that it is called not in just one target, but multiple that fall under the same path (a Directory handler attached at /foo will be called on /foo/etc, /foo/some and so on) The Server struct provides us with some methods in order to attach handlers. These are the following: Server::on() to attach generic Any handlers Server::on_METHOD() to attach handler for a specific METHOD (for example, on_get attaches a Specific GET handler) Server::on_directory() to attach a Directory handler All the above function have the same function signature: that means that all of them take a &str or String as the target argument and a HandlerCallback as the second argument Let's attach those handlers to our server now: # extern crate oak_http_server;
use oak_http_server::{Request, Response, Server}; fn example_handler_func(_request: Request, response: Response) { // This handler responds to the HTTP request with a predefined string response.end_with("I am a concrete function handler!!!");
} fn main() { let example_handler_closure = |_request: Request, response: Response| { // This handler responds to the HTTP request with a predefined string response.end_with("And I am a closure!!!"); }; let hostname = "localhost"; let port: u16 = 2300; // Create a Server instance let mut server = Server::new(hostname, port); // Append generic function handler server.on("/function", example_handler_func); // Append closure handler that responds only to `GET` requests server.on_get("/closure", example_handler_closure); // Start the HTTP server server.start(|| { println!("HTTP server is now running..."); });
} Similarly, you can create your own handlers. With this library, the sky's the limit to what you can do.

